import React from 'react'
import { Text, StyleSheet, View, Button,ImageBackground} from 'react-native'

const HomeScreen = (props) => {
  console.log(props)
  const navigation = props.navigation

  return (
    <ImageBackground
    source={require('./images/backgroundcalculadora.jpg')}
    style={styles.background} >

    <View   style={styles.principal}>
    <TouchableOpacity
    onPress={() => {
      console.log('button pressed');
      navigation.navigate('Calculadora1');
    }}
    style={styles.button}
  >
    <Text style={styles.buttonText}>CALCULADORA 1</Text>
  </TouchableOpacity>

  <TouchableOpacity
    onPress={() => {
      console.log('button pressed');
      navigation.navigate('Calculadora2');
    }}
    style={styles.button}
  >
    <Text style={styles.buttonText}>CALCULADORA 2</Text>
  </TouchableOpacity>

    </View>
    </ImageBackground>
  )
}

const styles = StyleSheet.create({

 button:{
  backgroundColor: 'black',
  padding: 10,
  margin: 10,
  borderRadius: 5,
 } ,
 buttonText: {
  color: 'white',
  fontSize: 18,
},
  background: {
    flex: 1,
    resizeMode: 'cover', 
  },
  principal: {
    flex: 1,
    justifyContent: 'space-evenly',
    alignItems: 'center',
    backgroundColor: 'rgba(0, 0, 0, 0.5)', 
  },
})

export default HomeScreen
